INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122601, 1, 1, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 160, 1.5, 105, 101, 0.029, 0, 0, 110, 1);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122401, 3, 2, 0, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 120, 2.5, 111, 102, 0.014, 0, 1, 105, 2);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122501, 2, 3, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 350, 2.5, 105, 103, 0.017, 1, 0, 110, 3);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107501, 3, 4, 0, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 130, 1.5, 105, 104, 0.016, 0, 1, 110, 4);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107601, 1, 5, 1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 160, 2.5, 105, 105, 0.014, 0, 0, 110, 5);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107801, 2, 6, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 255, 3.5, 103, 106, 0.029, 1, 0, 120, 6);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110601, 1, 7, 1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 160, 3.5, 103, 107, 0.013, 0, 0, 120, 7);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110401, 2, 8, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 350, 2.5, 103, 108, 0.014, 1, 0, 110, 8);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110501, 3, 9, 0, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 130, 1.5, 100, 109, 0.012, 0, 1, 105, 9);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (115701, 1, 10, 1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 200, 2.5, 103, 110, 0.014, 0, 0, 105, 10);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113601, 2, 11, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 350, 2.5, 103, 111, 0.071, 1, 0, 105, 11);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107901, 3, 12, 0, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 130, 1.5, 103, 112, 0.014, 0, 1, 120, 12);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108001, 2, 13, 1, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 200, 1.5, 105, 113, 0.022, 0, 0, 110, 13);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110301, 1, 14, 1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 160, 2.5, 108, 114, 0.031, 0, 0, 110, 14);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107701, 1, 15, 0, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 130, 0.5, 105, 115, 0.036, 0, 1, 110, 15);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113101, 2, 16, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 350, 3.5, 95, 116, 0.048, 1, 0, 110, 16);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113301, 3, 17, 0, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 130, 1.5, 105, 117, 0.043, 0, 1, 105, 17);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113201, 2, 18, 0, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 130, 1.5, 95, 118, 0.018, 0, 1, 105, 18);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117001, 2, 19, 1, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 160, 2.5, 108, 119, 0.021, 0, 0, 110, 19);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113501, 1, 20, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 255, 2.5, 105, 120, 0.036, 1, 0, 110, 20);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113401, 3, 21, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 350, 2.5, 105, 121, 0.02, 1, 0, 105, 21);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110101, 1, 22, 0, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 130, 2.5, 105, 122, 0.018, 0, 1, 110, 22);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110001, 3, 23, 1, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 160, 3.5, 111, 123, 0.03, 0, 0, 105, 23);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117201, 1, 24, 0, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 130, 1.5, 103, 124, 0.027, 0, 1, 110, 24);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117301, 2, 25, 1, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 160, 3.5, 108, 125, 0.02, 0, 0, 105, 25);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117401, 3, 26, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 350, 2.5, 105, 126, 0.04, 1, 0, 110, 26);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117101, 1, 27, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 350, 3.5, 105, 127, 0.009, 1, 0, 110, 27);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122901, 1, 28, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 255, 3.5, 105, 128, 0.022, 1, 0, 120, 28);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122801, 3, 29, 0, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 130, 2.5, 105, 129, 0.028, 0, 1, 110, 29);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122701, 2, 30, 1, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 130, 3.5, 108, 130, 0.023, 0, 0, 105, 30);
